import React from 'react'

const Tracks = props => {
    console.log(props)
    return (
        <div>
            Tracks!
            Linked here by {props.location.state.list.name}
            <p onClick={props.history.goBack}>Go back</p>
        </div>
    )
}

export default Tracks
